import React from "react";
import { Row } from "react-bootstrap";

const NoMovies = () => {
  return (
    
      <Row class="containerNoMovies">
        <h1>لا يوجد أفلام</h1>
        <p>عذرًا، لا توجد أفلام متاحة في الوقت الحالي.</p>
      </Row>
    
  );
};

export default NoMovies;
